import React from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { MDBBtn, MDBContainer } from "mdb-react-ui-kit";
import MainNav from "./MainNav";
import HeroSlider from "./HeroSlider";
import SortByContent from "./SortByContent";
import LandingPageCards from "./LandingPageCards";
import LandingPageCards1 from "./LandingPageCards1";
import LandingPageCards2 from "./LandingPageCards2";
import LandingPageCards3 from "./LandingPageCards3";
import LandingPageCards4 from "./LandingPageCards4";
import CardSlider from "./CardSlider";
import ImgOverlay from "./ImgOverlay";
import CustomerReviews from "./Agents";

function LandingPage() {
    return (
        <div className="landing_page">
            <HeroSlider />
        <SortByContent />
        <LandingPageCards />
        <ImgOverlay />
        <Agents />
        </div>
    )
}

export default LandingPage
